(2, 'Upper Text Left', 'United States - English', 'en-us', 'upper-text-left', '<h2>About Logomax</h2>\r\n<p><em>Unveiling Unique Identities, One Logo at a Time</em></p>\r\n<p>Welcome to Logomax, where exclusivity meets design. In a digital world brimming with repetitive and overused logos, we stand out by oﬀering a unique proposition - exclusive, once-in-a-lifetime logos. Established 2012, Logomax has been dedicated to creating and curating a diverse range of logo designs, each sold only once. At Logomax, we understand that a logo is more than just a graphic; it\'s the face of your brand, a visual story waiting to be told. Our platform brings together skilled designers from across the globe, each contributing to our eclectic mix of styles. Whether you\'re a budding startup or a seasoned enterprise, our collection has something for every brand personality.</p>', 'textarea', NULL, '2023-12-22 17:40:32'),
(3, 'Upper Text Right', 'United States - English', 'en-us', 'upper-text-right', '<h2>&nbsp;</h2>\r\n<p>&nbsp;</p>\r\n<p>Our vision at Logomax is simple yet profound - to empower businesses with the ability to own a distinctive piece of art that sets them apart. With Logomax, when you buy a logo, you\'re not just making a purchase; you\'re claiming exclusivity. You become the sole owner of a design that can deﬁne your brand for years to come.</p>\r\n<p>We specialize in two tiers of logos - Low-priced Logos and Premium Logos, catering to a wide range of budgets without compromising on the uniqueness and quality of designs. Our categories, including Leter Mark Logos, Pictorial Mark Logos, Abstract Logos, Emblem Logos, Dynamic Logos, Minimalistic Logos, Geometric Logos and Combination Logos, ensure that you ﬁnd a logo that resonates with your brand\'s ethos eﬀortlessly.</p>', 'textarea', NULL, '2024-01-17 19:47:35'),
(4, 'video image', 'United States - English', 'en-us', 'video-image', '2023-11-09_102227_video-img.png', 'file', NULL, NULL),
(5, 'video link', 'United States - English', 'en-us', 'video-link', 'https://www.youtube.com/embed/M2kSJbLbIgQ', 'link', NULL, NULL),
(6, 'Contact Us', 'United States - English', 'en-us', 'contact-us', '<h2>Contact Us</h2>\r\n<p>Send us your questions, comments, or suggestions and we will address them as quickly as possible. You can also check out our Help Center. Have another question? Contact us and we will get back to you as quickly as possible</p>', 'textarea', NULL, '2023-12-22 17:40:32'),
(7, 'video Text Title', 'United States - English', 'en-us', 'video-text-title', '<h2>Our Commitment</h2>\r\n<p>Ensuring Satisfaction with Every Logo Story</p>', 'textarea', NULL, '2023-12-22 17:40:32'),
(8, 'video Text', 'United States - English', 'en-us', 'video-text', '<p>Your journey to an iconic brand identity is paramount to us. At Logomax, we<br>ensure that every interaction is seamless, from browsing to purchasing your<br>exclusive logo. Our dedicated support team is always on standby to assist, making<br>your experience smooth and enjoyable.</p>\r\n<p>Choosing Logomax means opening for originality, exclusivity, and a commitment to quality. Join us in redeﬁning the way the world sees logos. With Logomax, embark on a journey to a distinctive brand identity that\'s truly your own.</p>', 'textarea', NULL, '2023-12-22 17:40:32'),
