(415, 'Upper Text Title', 'United Arab Emirates - English', 'en-uae', 'upper-text-title', '', 'textarea', NULL, NULL),
(416, 'Upper Text Left', 'United Arab Emirates - English', 'en-uae', 'upper-text-left', '<h2>About Logomax</h2><p><em>Unveiling Unique Identities, One Logo at a Time</em></p><p>Welcome to Logomax, where exclusivity meets design. In a digital world brimming with repetitive and overused logos, we stand out by oﬀering a unique proposition - exclusive, once-in-a-lifetime logos. Established 2012, Logomax has been dedicated to creating and curating a diverse range of logo designs, each sold only once. At Logomax, we understand that a logo is more than just a graphic; it\'s the face of your brand, a visual story waiting to be told. Our platform brings together skilled designers from across the globe, each contributing to our eclectic mix of styles. Whether you\'re a budding startup or a seasoned enterprise, our collection has something for every brand personality.</p>', 'textarea', NULL, NULL),
(417, 'Upper Text Right', 'United Arab Emirates - English', 'en-uae', 'upper-text-right', '<h2>Our Vision</h2><p><em>Crafting Distinctive Brands with Exclusive Designs</em></p><p>Our vision at Logomax is simple yet profound - to empower businesses with the ability to own a distinctive piece of art that sets them apart. With Logomax, when you buy a logo, you\'re not just making a purchase; you\'re claiming exclusivity. You become the sole owner of a design that can deﬁne your brand for years to come.</p><p>We specialize in two tiers of logos - Low-priced Logos and Premium Logos, catering to a wide range of budgets without compromising on the uniqueness and quality of designs. Our categories, including Leter Mark Logos, Pictorial Mark Logos, Abstract Logos, Emblem Logos, Dynamic Logos, Minimalistic Logos, Geometric Logos and Combination Logos, ensure that you ﬁnd a logo that resonates with your brand\'s ethos eﬀortlessly.</p>', 'textarea', NULL, NULL),
