INSERT INTO `logo_facilities` (`id`, `language`, `lang_code`, `facilities_name`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1, 'United States - English', 'en-us', 'Rapid, Free Customization', 'Download your logo files instantly upon purchase. Need adjustments? Our complimentary customizaon service delivers changes within 1 business day. Enjoy up to 3 revisions, covering brand name, colors, and fonts to ensure your logo perfectly suits your vision.', 1, NULL, NULL),
(2, 'United States - English', 'en-us', 'Exclusivity Guaranteed', 'Each logo is designed to be one-of-a-kind and will only be sold to a single customer. This means your brand will have a unique identy that stands out from competors, and you can be confident in a logo that truly represents your business.', 1, NULL, NULL),
(3, 'United States - English', 'en-us', 'Ready to Use', 'As predesigned logos, they\'re ready to be used right away. No waing for designers to create something from scratch – you can start building your brand immediately.', 1, NULL, NULL),
(4, 'United States - English', 'en-us', 'Brand Registration Allowed', 'We allow brand registration, ensuring that your chosen logo is legally protected. This helps you establish your brand\'s authencity and safeguards it from potenal infringements.', 1, NULL, '2023-12-08 17:41:27'),
(5, 'United States - English', 'en-us', 'Affordable Pricing', 'Building a brand doesn\'t have to break the bank. Our logos offer a cost-effecve soluon for businesses looking to establish a strong visual identy.', 1, NULL, NULL),
(6, 'United States - English', 'en-us', 'Unrestricted License: Your Brand, Your Terms', 'Our licensing agreement grants you exclusive ownership of the logo. Feel free to ulize it in any manner you prefer, without the need to acknowledge us. Shape your brand identy on your terms.', 1, NULL, NULL),
