INSERT INTO `support_contents` (`id`, `meta_name`, `language`, `lang_code`, `meta_key`, `meta_value`, `type`, `created_at`, `updated_at`) VALUES
(1, 'Support Text', 'United States - English', 'en-us', 'support_text', '<p>Welcome to Logomax, where exclusivity meets design. In a digital world brimming with repetive and overused logos, we stand out by offering a unique proposition - exclusive, once-in-a-lifetime logos. Established 2012, Logomax has been dedicated to creating and curating a diverse range of logo designs, each sold only once. At Logomax, we understand that a logo is more than just a graphic; it\'s the face of your brand, a visual story waiting to be told. Our platform brings together skilled designers from across the globe, each contributing to our eclectic mix of styles. Whether you\'re a budding startup or a seasoned enterprise, our collection has something for every brand personality.</p>', 'textarea', NULL, NULL),
