(31, 'Support Text', 'Deutschland - Deutsch', 'de-de', 'support_text', '<p>Willkommen bei Logomax, wo Exklusivität auf Design trifft. In einer digitalen Welt voller sich wiederholender und überstrapazierter Logos zeichnen wir uns durch ein einzigartiges Angebot aus: exklusive, einmalige Logos. Logomax wurde 2012 gegründet und hat sich der Erstellung und Kuratierung einer vielfältigen Palette an Logodesigns verschrieben, die jeweils nur einmal verkauft werden. Bei Logomax verstehen wir, dass ein Logo mehr als nur eine Grafik ist; Es ist das Gesicht Ihrer Marke, eine visuelle Geschichte, die darauf wartet, erzählt zu werden. Unsere Plattform bringt erfahrene Designer aus der ganzen Welt zusammen, die jeweils zu unserem vielseitigen Stilmix beitragen. Egal, ob Sie ein aufstrebendes Startup oder ein erfahrenes Unternehmen sind, in unserer Kollektion ist für jede Markenpersönlichkeit etwas dabei.</p>', 'textarea', NULL, '2023-12-08 13:05:35'),
